We will use the fact that any quantity can be expressed in a unique form by taking the $n^{th}$ root of a number for some integer $n$, and an integer $b\ge 2$ (base for the exponent).
### Case 1:  3^{-2}
The expression $3^{-2}$ is a rational number since it can be expressed in the form $\frac{a}{b}$ with $a$, $b$ positive integers where $a$, $b$ are relatively prime, $b\ne0$. In this case, it’s not hard to find that $\frac{1}{9}$. Therefore, the set of values represented is $\{\frac{1}{9}\}$.
